function get_all_tweets(){$.ajax({type:"GET",async:!1,dataType:"json",url:"https://gutenmorgen.herokuapp.com/tweets",success:function(a){return a}})}function get_tweets_by_country(a){$.ajax({type:"GET",async:!1,dataType:"json",url:`https://gutenmorgen.herokuapp.com/tweets/country/${a}`,success:function(a){return a}})}function get_tweets_by_time(a,b){$.ajax({type:"GET",async:!1,dataType:"json",url:`https://gutenmorgen.herokuapp.com/tweets/time/${a}/${b}`,success:function(a){return a}})}module.exports={get_all_tweets:get_all_tweets,get_tweets_by_country:get_tweets_by_country,get_tweets_by_time:get_tweets_by_time};